import Header from "./Header";
import Hero from "./Hero";
import Services from "./Services";
import Footer from "./Footer";

export default function App() {
  return (
    <div className="font-sans bg-gray-900 text-white">
      <Header />
      <main className="mt-20">
        <Hero />
        <Services />
      </main>
      <Footer />
    </div>
  );
}
